import React, { useState, useEffect } from "react";
import Sidebar from "../components/Sidebar";
import NewFolderModal from "../components/NewFolderModal";

export default function UserDashboard() {
  const [folders, setFolders] = useState(() => {
    const saved = localStorage.getItem("folders");
    return saved ? JSON.parse(saved) : [];
  });

  const [currentFolder, setCurrentFolder] = useState(null);

  const [showNewFolder, setShowNewFolder] = useState(false);
  const [search, setSearch] = useState("");

  useEffect(() => {
    localStorage.setItem("folders", JSON.stringify(folders));
  }, [folders]);

  const handleCreateFolder = (name) => {
    if (!name.trim()) return alert("Folder name required!");
    const newFolder = { id: Date.now(), name, files: [] };
    setFolders((prev) => [...prev, newFolder]);
  };

  const handleUpload = (fileData) => {
    const newFile = {
      id: Date.now(),
      name: fileData.name,
      size: `${(fileData.size / 1024).toFixed(1)} KB`,
      date: new Date().toISOString().split("T")[0],
      url: fileData.Url,
    };

    if (currentFolder) {
      setFolders((prev) =>
        prev.map((f) =>
          f.id === currentFolder.id
            ? { ...f, files: [...f.files, newFile] }
            : f
        )
      );
    } else {
      setFolders((prev) => {
        const root = prev.find((f) => f.name === "__ROOT__");
        if (root) {
          root.files.push(newFile);
          return [...prev];
        }
        return [...prev, { id: "root", name: "__ROOT__", files: [newFile] }];
      });
    }

    const history = JSON.parse(localStorage.getItem("history") || "[]");
    history.push({
      id: Date.now(),
      fileName: newFile.name,
      folder: currentFolder ? currentFolder.name : "Root",
      date: newFile.date,
    });
    localStorage.setItem("history", JSON.stringify(history));
  };

  const handleOpenFolder = (folder) => setCurrentFolder(folder);
  const handleGoBack = () => setCurrentFolder(null);

  const filteredFolders = currentFolder
    ? currentFolder.files.filter((file) =>
        file.name.toLowerCase().includes(search.toLowerCase())
      )
    : folders.filter((f) =>
        f.name.toLowerCase().includes(search.toLowerCase())
      );

  return (
    <div className="flex min-h-screen bg-gray-50">
      <Sidebar />

      <div className="flex-1 p-6">
        {/* Header */}
        <div className="flex justify-between items-center mb-6">
          <div>
            <h1 className="text-2xl font-bold" style={{color: '#662222'}}>
              {currentFolder ? currentFolder.name : "My Documents"}
            </h1>
            {currentFolder && (
              <button
                onClick={handleGoBack}
                className="text-gray-600 text-sm hover:underline mt-1"
                style={{'--hover-color': '#662222'}}
                onMouseEnter={(e) => e.target.style.color = '#662222'}
                onMouseLeave={(e) => e.target.style.color = ''}
              >
                ‚Üê Back to My Documents
              </button>
            )}
          </div>

          {/* Actions */}
          <div className="flex items-center gap-3">
            <input
              type="text"
              placeholder="Search..."
              value={search}
              onChange={(e) => setSearch(e.target.value)}
              className="border border-gray-200 rounded-lg px-3 py-2 w-48 bg-white text-gray-700 outline-none"
              style={{'--focus-ring-color': '#662222'}}
              onFocus={(e) => e.target.style.borderColor = '#662222'}
              onBlur={(e) => e.target.style.borderColor = ''}
            />
            <button
              onClick={() => setShowNewFolder(true)}
              className="text-white px-4 py-2 rounded-lg transition-all duration-300 hover:scale-105"
              style={{
                backgroundColor: '#662222',
                boxShadow: '0 4px 15px rgba(102, 34, 34, 0.3)'
              }}
              onMouseEnter={(e) => {
                e.target.style.backgroundColor = '#4a1a1a';
                e.target.style.transform = 'translateY(-2px)';
              }}
              onMouseLeave={(e) => {
                e.target.style.backgroundColor = '#662222';
                e.target.style.transform = 'translateY(0)';
              }}
            >
              New Folder
            </button>

          </div>
        </div>

        {/* File Browser */}
        <div className="bg-gradient-to-br from-orange-100 to-red-100 rounded-2xl shadow-lg p-8 border border-red-200">
          <p className="text-gray-600 text-center py-8">
            This dashboard has been replaced by the enhanced File Dashboard.
            <br />
            <a href="/file-dashboard" className="font-medium transition-colors" style={{color: '#662222'}} onMouseEnter={(e) => e.target.style.textDecoration = 'underline'} onMouseLeave={(e) => e.target.style.textDecoration = 'none'}>
              Go to File Dashboard
            </a>
          </p>
        </div>

        {/* Modals */}

        {showNewFolder && (
          <NewFolderModal
            onClose={() => setShowNewFolder(false)}
            onCreate={handleCreateFolder}
          />
        )}
      </div>
    </div>
  );
}
